import json

def extract_relation(sentence, entities):
    # Define the schema definition
    schema_definition = {
        'Interface': 'is an interface of sending/receving data between the connected entities.',
        'Requirements Reference': 'is reference relation between requirements domain and other entities.',
        'Requirements Constraint': 'is constrain relation between requirements domain and other entities. It means the requirements domains does not just refer to the phenomena but constrains them.'
    }

    # Define the relation extraction rules
    relation_extraction_rules = {
        'Interface': lambda x, y: x in entities['Software System'] and y in entities['Environment Object'] or x in entities['External System'] and y in entities['Environment Object'],
        'Requirements Reference': lambda x, y: x in entities['System Requirements'] and y in entities['Software System'] or x in entities['System Requirements'] and y in entities['Physical Device'] or x in entities['System Requirements'] and y in entities['External System'],
        'Requirements Constraint': lambda x, y: x in entities['System Requirements'] and y in entities['Software System'] or x in entities['System Requirements'] and y in entities['Physical Device'] or x in entities['System Requirements'] and y in entities['External System']
    }

    # Extract the relation
    relation = {'Phenomena Interface': [], 'requirements reference': [], 'requirements constraint': []}
    for relation_type, rule in relation_extraction_rules.items():
        for entity in entities['Software System']:
            for phenomenon in entities['Shared Phenomena']:
                if rule(entity, phenomenon):
                    relation['Phenomena Interface'].append([entity, phenomenon])
        for entity in entities['External System']:
            for phenomenon in entities['Shared Phenomena']:
                if rule(entity, phenomenon):
                    relation['Phenomena Interface'].append([entity, phenomenon])
        for requirement in entities['System Requirements']:
            for entity in entities['Software System']:
                if rule(requirement, entity):
                    relation['requirements reference'].append([requirement, entity])
            for entity in entities['Physical Device']:
                if rule(requirement, entity):
                    relation['requirements reference'].append([requirement, entity])
            for entity in entities['External System']:
                if rule(requirement, entity):
                    relation['requirements reference'].append([requirement, entity])
        for requirement in entities['System Requirements']:
            for entity in entities['Software System']:
                if rule(requirement, entity):
                    relation['requirements constraint'].append([requirement, entity])
            for entity in entities['Physical Device']:
                if rule(requirement, entity):
                    relation['requirements constraint'].append([requirement, entity])
            for entity in entities['External System']:
                if rule(requirement, entity):
                    relation['requirements constraint'].append([requirement, entity])

    return json.dumps(relation)

